			shellPath = /bin/bash;
			shellScript = "#!/bin/bash\nset -e\n\necho \"üîê Signing FFmpeg for distribution...\"\n\nFFMPEG_PATH=\"${BUILT_PRODUCTS_DIR}/${FULL_PRODUCT_NAME}/Contents/Resources/ffmpeg\"\n\n# Find Developer ID certificate\necho \"üîç Looking for Developer ID Application certificate...\"\nsecurity find-identity -v -p codesigning\n\nDEVELOPER_ID_CERT=$(security find-identity -v -p codesigning | grep \"Developer ID Application\" | head -1 | cut -d '\"' -f 2)\n\nif [ -z \"$DEVELOPER_ID_CERT\" ]; then\n    echo \"‚ùå No Developer ID Application certificate found!\"\n    exit 1\nfi\n\necho \"‚úÖ Using certificate: $DEVELOPER_ID_CERT\"\n\n# Find entitlements\nENTITLEMENTS_PATHS=(\n    \"${SRCROOT}/ffmpeg.entitlements\"\n    \"${PROJECT_DIR}/ffmpeg.entitlements\"\n    \"$(dirname \"$0\")/ffmpeg.entitlements\"\n    \"/Users/user2/Desktop/ExhaleGUIApp/ffmpeg.entitlements\"\n)\n\nENTITLEMENTS_PATH=\"\"\nfor path in \"${ENTITLEMENTS_PATHS[@]}\"; do\n    echo \"üîç Checking entitlements path: $path\"\n    if [ -f \"$path\" ]; then\n        ENTITLEMENTS_PATH=\"$path\"\n        echo \"‚úÖ Found entitlements at: $path\"\n        break\n    fi\ndone\n\nif [ -z \"$ENTITLEMENTS_PATH\" ]; then\n    echo \"‚ùå Entitlements file not found!\"\n    exit 1\nfi\n\n# Check current ffmpeg signature before signing\necho \"üîç Current ffmpeg signature BEFORE signing:\"\ncodesign -dv \"$FFMPEG_PATH\" || echo \"No existing signature\"\n\n# Sign with Developer ID certificate\necho \"üîê Running codesign command...\"\ncodesign --force \\\n         --sign \"$DEVELOPER_ID_CERT\" \\\n         --entitlements \"$ENTITLEMENTS_PATH\" \\\n         --options runtime \\\n         --timestamp \\\n         --verbose \\\n         \"$FFMPEG_PATH\"\n\nCODESIGN_RESULT=$?\necho \"üîç Codesign exit code: $CODESIGN_RESULT\"\n\nif [ $CODESIGN_RESULT -eq 0 ]; then\n    echo \"‚úÖ Codesign command completed successfully\"\n    \n    # Verify the signature worked\n    echo \"üîç Verifying ffmpeg signature AFTER signing:\"\n    codesign -dv \"$FFMPEG_PATH\"\n    \n    # Check for runtime flag specifically\n    echo \"üîç Checking for runtime flag:\"\n    codesign -d --entitlements - \"$FFMPEG_PATH\"\nelse\n    echo \"‚ùå Codesign failed with exit code: $CODESIGN_RESULT\"\n    exit 1\nfi\n\necho \"‚úÖ Script completed successfully\"\n";
